import React from 'react';
import resume1 from '../img/resume2020img1.jpg';
import resume2 from '../img/resume2020img2.jpg';

const Resume = () => {

    return (
       <div className="ml-16 relative container border inline-block  " >
        <h1 className="text-center text-5xl mt-3 font-semibold"> Resume </h1>
        <img src={resume1} />
      </div>
    )
  }


export default Resume;
